Method names ( collection_new ) are stable Additional methods may be added in the future Parameter names, types, and count are stable (new parameter fields to an existing method will never be added) Additional response fields to an existing method may be added in the future Although old response fields will remain, the ordering of response fields should NOT be relied upon These rules also apply to the Common Objects Old v1.0.0 JSON-RPC example: // Request
{ "jsonrpc": "2.0", "method": "This will never change", "param": { "param_field": "This will never change" }, "id": 0,
} // Response
{ "jsonrpc": "2.0", "result": { "result_field": "Introduced in v1.0.0" }, "id": 0,
} New v1.x.x JSON-RPC example: // Request
{ "jsonrpc": "2.0", "method": "This will never change", "param": { "param_field": "This will never change" }, "id": 0,
} // Response
{ "jsonrpc": "2.0", "result": { "result_field3": "Introduced in v1.3.x", "result_field": "Introduced in v1.0.0", "result_field2": "Introduced in v1.2.x" }, "id": 0,
}

